import React from 'react';
import { Grid, TextField, InputAdornment, Button, Card, CardContent, Typography } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import EventSeatIcon from '@mui/icons-material/EventSeat';
import TheatersIcon from '@mui/icons-material/Theaters';
import BarChartIcon from '@mui/icons-material/BarChart';
import MetricCard from '../components/MetricCard';

const AdminDashboard = () => {
  const [searchQuery, setSearchQuery] = React.useState('');

  return (
    <div style={{ padding: '24px' }}>
      {/* Search Bar */}
      <TextField
        fullWidth
        placeholder="Search movies, events, cinemas..."
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <SearchIcon />
            </InputAdornment>
          ),
        }}
        sx={{ mb: 4 }}
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
      />

      {/* Navigation Buttons */}
      <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '24px' }}>
        <Button
          variant="contained"
          color="primary"
          fullWidth
          sx={{ marginRight: 2 }}
          onClick={() => alert('Movies Button Clicked')}
        >
          Movies
        </Button>
        <Button
          variant="contained"
          color="secondary"
          fullWidth
          sx={{ marginRight: 2 }}
          onClick={() => alert('Events Button Clicked')}
        >
          Events
        </Button>
        <Button
          variant="contained"
          color="success"
          fullWidth
          onClick={() => alert('Theaters Button Clicked')}
        >
          Theaters
        </Button>
      </div>

      {/* Key Metrics */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard 
            title="Total Bookings"
            value="2,456"
            icon={<EventSeatIcon fontSize="large" />}
            progress={75}
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard
            title="Active Shows"
            value="148"
            icon={<TheatersIcon fontSize="large" />}
            trend="+12%"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard
            title="Total Revenue"
            value="$45,230"
            icon={<BarChartIcon fontSize="large" />}
          />
        </Grid>
      </Grid>

      {/* Recent Bookings Section */}
      <Card elevation={3} sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Recent Bookings
          </Typography>
          {/* Booking Table Placeholder */}
          <div style={{ height: 200 }}>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              height: '100%',
              color: '#666'
            }}>
              Booking management table (Coming Soon)
            </div>
          </div>
        </CardContent>
      </Card>
    </div>
  );
};

export default AdminDashboard;
